  `churn` int DEFAULT NULL,
  `help_others` int DEFAULT NULL,
  `legacy_refactor` int DEFAULT NULL,
  `new_work` int DEFAULT NULL,
  `impact` int DEFAULT NULL,
  `cyclomatic_complexity` double DEFAULT NULL,
  `dmm_size` double DEFAULT NULL,
  `dmm_interfacing` double DEFAULT NULL,
  `file_added_count` int DEFAULT NULL,
  `file_deleted_count` int DEFAULT NULL,
  `file_modified_count` int DEFAULT NULL,
  `number_of_modified_line` int DEFAULT NULL,
  `number_of_inserted_line` int DEFAULT NULL,
  `number_of_deleted_line` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `IDX_22E0C9BAF675F31B` (`author_id`),
  KEY `IDX_22E0C9BA50C9D4F7` (`repository_id`),
  CONSTRAINT `FK_22E0C9BA50C9D4F7` FOREIGN KEY (`repository_id`) REFERENCES `repository` (`id`),
  CONSTRAINT `FK_22E0C9BAF675F31B` FOREIGN KEY (`author_id`) REFERENCES `git_author` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=878 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
